/* Theme: rosePink */
@theme reference {
  --color-rosePink-background: 0 0% 100%;
  --color-rosePink-foreground: 0 0% 3.9%;
  --color-rosePink-card: 0 0% 100%;
  --color-rosePink-card-foreground: 0 0% 3.9%;
  --color-rosePink-popover: 0 0% 100%;
  --color-rosePink-popover-foreground: 0 0% 3.9%;
  --color-rosePink-primary: 330 81% 60%;
  --color-rosePink-primary-foreground: 0 0% 98%;
  --color-rosePink-secondary: 327 73% 97%;
  --color-rosePink-secondary-foreground: 0 0% 9%;
  --color-rosePink-muted: 210 40% 96%;
  --color-rosePink-muted-foreground: 0 0% 45.1%;
  --color-rosePink-accent: 326 85% 90%;
  --color-rosePink-accent-foreground: 0 0% 9%;
  --color-rosePink-destructive: 0 72% 51%;
  --color-rosePink-destructive-foreground: 0 0% 100%;
  --color-rosePink-border: 214 32% 91%;
  --color-rosePink-input: 214 32% 91%;
  --color-rosePink-ring: 330 81% 60%;
}

.theme-rosePink {
  --color-background: var(--color-rosePink-background);
  --color-foreground: var(--color-rosePink-foreground);
  --color-card: var(--color-rosePink-card);
  --color-card-foreground: var(--color-rosePink-card-foreground);
  --color-popover: var(--color-rosePink-popover);
  --color-popover-foreground: var(--color-rosePink-popover-foreground);
  --color-primary: var(--color-rosePink-primary);
  --color-primary-foreground: var(--color-rosePink-primary-foreground);
  --color-secondary: var(--color-rosePink-secondary);
  --color-secondary-foreground: var(--color-rosePink-secondary-foreground);
  --color-muted: var(--color-rosePink-muted);
  --color-muted-foreground: var(--color-rosePink-muted-foreground);
  --color-accent: var(--color-rosePink-accent);
  --color-accent-foreground: var(--color-rosePink-accent-foreground);
  --color-destructive: var(--color-rosePink-destructive);
  --color-destructive-foreground: var(--color-rosePink-destructive-foreground);
  --color-border: var(--color-rosePink-border);
  --color-input: var(--color-rosePink-input);
  --color-ring: var(--color-rosePink-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-rosePink {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 330 81% 90%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 326 85% 30%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 330 81% 90%;
  }
}

